import React, {useState} from 'react';
import {toast} from "react-toastify";
import ProductItem from "./ProductItem";
import {Link} from "react-router-dom";
import AddProductPage from "./CategoryPages/AddProductPage";

const AdminPage = () => {
    const [productName, setProductName] = useState('');
    const [category, setCategory] = useState('');
    const [price, setPrice] = useState('');
    const [imgUrl, setImgUrl] = useState('');
    const [quantity, setQuantity] = useState('');
    function showAllProduct(e) {
        e.preventDefault();
        const product = {productName, category, price, imgUrl, quantity}
        console.log(product);
        fetch("http://localhost:8080/nexusHub/product", {
            method: "GET",
            headers: {"Content-Type": "application/json"},
            body: JSON.stringify(product)
        }).catch((error) => {
                console.error('Error:', error);
            });
    }

    return (
        <div>
            <button className="btn btn-primary"><Link to={<AddProductPage/>}>Add new product</Link></button>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Category</th>
                        <th>Price</th>
                        <th>Quantity</th>
                        <th>Image</th>
                        <th>Update</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td><ProductItem/></td>
                    </tr>
                </tbody>

                

            </table>
        </div>
    );
};

export default AdminPage;
